import React from "react";
import "./index.scss";

const HippoInfo = ({ hippo }) => {
  return (
    <div className="hippo-info">
      <div>
        {hippo?.resource?.name?.map((n) => {
          return n.given;
        })}
      </div>
      <span>
        Updated at: {new Date(hippo.updated_at).toISOString().split("T")[0]}
      </span>
    </div>
  );
};

export default HippoInfo;
